INSERT INTO `partialcontent` VALUES (1,' <span style=\"text-align: justify;\"><br>\r\n            &nbsp; <span style=\"font-size: 16px;\">&nbsp;System Science and Engineering has emerged as a research field that covers a wide spectrum of modern technology. A system can be considered as a collection of entities and their interrelationships gathered together to form a whole greater than the sum of the entities. It also involves people, organizations, cultures, activities and interrelationships among them. While systems composed of autonomous subsystems are not new, increased data density, connectivity and ubiquitous computational resources have increased their interdependence and interaction complexity. This has in turn made the already difficult job of planning, developing and deploying complex systems even more difficult.<br>\r\n            </span></span><span style=\"font-size: 16px;\"><span style=\"font-size: 16px;\"><span style=\"text-align: justify; font-size: 16px;\"><br>\r\n            &nbsp; &nbsp;Technology advancement not only provides opportunities for improving system capabilities but also introduces development risks that must be weighed and managed. Thus, it is our goal to bring together scholars from all areas to have a forum to discuss, demonstrate and exchange research ideas in the scope of system science and engineering.</span><br style=\"text-align: justify;\">\r\n            <br style=\"text-align: justify;\">\r\n            <span style=\"text-align: justify; font-size: 16px;\">&nbsp; &nbsp;The International Conference on System Science and Engineering 2017 (ICSSE 2017) is an international conference that will take place in Ho Chi Minh City during July 21-23, 2017. This event will provide a great opportunity for scientists, engineers, and practitioners from all over the world to present the latest system design concepts, research results, developments and applications, as well as to facilitate interactions between scholars and practitioners. ICSSE 2017 will feature plenary speeches in emerging technology topics given by world renowned scholars. The proceedings of ICSSE 2017 will be published by the IEEE with EI indexing. In addition, selected high-quality papers will be published by special issues of SCI-indexed journals.</span>&nbsp;</span><br></span><br>\r\n            <strong>ICSSE <strong style=\"text-align: justify;\">PUBLISHED&nbsp;</strong>PROCEEDINGS</strong><br>\r\n            <br>\r\n            ICSSE 2010: <a href=\"http://ieeexplore.ieee.org/xpl/mostRecentIssue.jsp?punumber=5540658\" target=\"_blank\">http://ieeexplore.ieee.org/xpl/mostRecentIssue.jsp?punumber=5540658</a><br>\r\n            ICSSE 2012: <a href=\"http://ieeexplore.ieee.org/xpl/mostRecentIssue.jsp?punumber=6246741\" target=\"_blank\">http://ieeexplore.ieee.org/xpl/mostRecentIssue.jsp?punumber=6246741</a><br>\r\n            ICSSE 2014: <a href=\"http://ieeexplore.ieee.org/xpl/mostRecentIssue.jsp?punumber=6879759\" target=\"_blank\">http://ieeexplore.ieee.org/xpl/mostRecentIssue.jsp?punumber=6879759</a><br>\r\n            ICSSE 2016: <a href=\"http://ieeexplore.ieee.org/xpl/mostRecentIssue.jsp?punumber=7548195\" target=\"_blank\">http://ieeexplore.ieee.org/xpl/mostRecentIssue.jsp?punumber=7548195</a><br>\r\n            ICSSE 2017:&nbsp;<a href=\"http://ieeexplore.ieee.org/xpl/mostRecentIssue.jsp?punumber=8024255\" target=\"_blank\">http://ieeexplore.ieee.org/xpl/mostRecentIssue.jsp?punumber=8024255</a><br>\r\n            <br>'),(2,'<strong style=\"color: #002060;\">CONFERENCE VENUE:</strong><span style=\"font-weight: bold; font-size: 20px; color: #002060;\"><br>\r\n<span style=\"font-size: 20px;\"></span><span style=\"font-size: 20px;\"></span></span><span style=\"font-size: 16px;\"><span style=\"font-size: 20px; color: #c00000;\"><span style=\"font-size: 20px;\"><span style=\"font-weight: bold; font-size: 20px;\"><br>\r\nHo Chi Minh City University of Technology and Education</span><br>\r\n</span>No. 01 Vo Van Ngan Street, Thu Duc District, Ho Chi Minh City</span><br>\r\n<br>\r\n</span><span style=\"color: #002060;\"><img alt=\"\" src=\"static/images/HCMUTE.jpg\"></span><br>\r\n<br>\r\n<span style=\"font-weight: bold; color: #002060;\"><br>\r\n<br>\r\n<span style=\"font-size: 20px;\">WELCOME DINNER VENUE:</span></span><br>\r\n<span style=\"color: #c00000;\"><br>\r\n<!--StartFragment--><span style=\"font-size: 11pt;\"><span style=\"font-weight: bold; font-size: 20px;\">Kim Dung Restaurant</span><span style=\"font-weight: bold;\">&nbsp;</span><br>\r\n</span></span><span style=\"color: #c00000;\"><span style=\"font-size: 11pt;\"><span style=\"font-size: 20px;\">No. 02, Dang Van Bi Street, Thu Duc District, Ho Chi Minh City<br>\r\n<br>\r\n<img alt=\"\" src=\"static/images/kimdung1.png\"><br>\r\n<br>\r\n<img alt=\"\" src=\"static/images/kimdung2.png\"><br>\r\n</span></span></span><div><font color=\"#c00000\"><span style=\"font-size: 20px;\"><br></span></font></div><div><img src=\"data:image/jpeg;base64,\"><font color=\"#c00000\"><span style=\"font-size: 20px;\"><br></span></font>\r\n<br></div>'),(3,'<div><strong style=\"color: rgb(0, 32, 96);\">CONFERENCE&nbsp;</strong><br></div>\r\n<span style=\"color: #002060;\">Email: icsse2017@hcmute.edu.vn</span><br style=\"color: #002060;\">\r\n<span style=\"color: #002060;\">Location: HCMC University of Technology and Education</span><br style=\"color: #002060;\">\r\n<span style=\"color: #002060;\">01 Vo Van Ngan Street, Linh Chieu Ward, Thu Duc District, Ho Chi Minh City&nbsp;</span><br style=\"color: #002060;\">\r\n<br style=\"color: #002060;\">\r\n<strong style=\"color: #002060;\">VIETNAM</strong><br style=\"color: #002060;\">\r\n<span style=\"color: #002060;\">1. A/P. Hoang An Quoc - Email: hanquoc@hcmute.edu.vn</span><br style=\"color: #002060;\">\r\n<span style=\"color: #002060;\">2. A/P. Do Thanh Trung - Email: trungdt@hcmute.edu.vn</span><br style=\"color: #002060;\">\r\n<br style=\"color: #002060;\">\r\n<strong style=\"color: #002060;\">TAIWAN</strong><br style=\"color: #002060;\">\r\n<span style=\"color: #002060;\">Prof. Yo-Ping Huang - Email:&nbsp;yphuang@ntut.edu.tw<br></span><span style=\"color: #002060;\"><br>\r\n<strong>Location on the map:</strong>\r\n<br>\r\n<br></span>');
